import React from 'react';
import ReactDOM from 'react-dom';

import "./App.css";
import App from './App.js';
import Navbar from './components/Navbar/Navbar.js';

const root = ReactDOM.createRoot(document.getElementById('root'));

function Main() {
    return (<>
        <Navbar />
        <App />
    </>);
}

root.render(<Main />);
